    @staticmethod
    def plot(oFile=None):
        paris = GeoDataFrameDemosB.villeDeParis()
        arrondissements = GeoDataFrameDemosB.arrondissementsDeParis()
        intraPeriph = GeoDataFrameDemosB.intraPeripherique()
        placeDesVosges = GeoDataFrameDemosB.placeDesVosges()
        buildings_placeDesVosges = GeoDataFrameDemosB.placeDesVosgesBuildings()
        trees_placeDesVosges = GeoDataFrameDemosB.placeDesVosgesTrees()

        # MAPPING
        minx, miny, maxx, maxy = paris.total_bounds

        fig, ax = plt.subplots(figsize=(1.5 * 8.26, 1.5 * 8.26))
        paris.boundary.plot(ax=ax, color="blue", linewidth=8.5)
        arrondissements.boundary.plot(ax=ax, color="red")
        arrondissements.apply(
            lambda x: ax.annotate(
                text=x.INSEE_ARM % 100,
                xy=x.geometry.centroid.coords[0],
                color="black",
                size=12,
                ha="center",
            ),
            axis=1,
        )
        intraPeriph.boundary.plot(ax=ax, color="green", linewidth=8.5)
        placeDesVosges.plot(ax=ax, color="yellow", linewidth=8.5)
        buildings_placeDesVosges.plot(ax=ax, color="gray")
        trees_placeDesVosges.plot(ax=ax, color="green", marker=".")
        ax.axis("off")
        ax.axis([minx, maxx, miny, maxy])
        plt.tight_layout()
        if oFile is None:
            fig.tight_layout()
            plt.show()
        else:
            plt.savefig(oFile, bbox_inches="tight")
        plt.close(fig)


